import Modal from "@/components/reusable/modal.vue";
export default {
  data: function data() {
    return {
      imageUrl: ""
    };
  },
  components: {
    modal: Modal
  },
  created: function created() {
    this.$store.dispatch("getUserBookings", this.$store.getters.userId);
    this.$store.dispatch("loadThemes");
    this.$store.dispatch("loadAddons");
  },
  methods: {
    catchParse: function catchParse(thing) {
      try {
        return JSON.parse(thing.replace(/\n/g, "<br>"));
      } catch (_unused) {
        console.error("catchParse: Error - can't parse " + thing);
      }
    },
    logg: function logg(text) {
      console.log(text);
    },
    submitPayment: function submitPayment(booking_id) {
      console.log("Called Submit Payment");
      console.log("imageurl:" + this.imageUrl);
      var formdata = new FormData();
      formdata.append("booking_id", booking_id);
      formdata.append("deposit_slip", this.imageUrl);
      this.$store.dispatch("submitPayment", formdata);
    },
    getTotalPrice: function getTotalPrice(params) {
      var array = this.catchParse(params).filter(function (addon) {
        return addon.addon_source != "BOOKING" && addon.addon_source != "PACKAGE";
      }).map(function (addon) {
        return addon.addon_price;
      });
      var x = 0;
      array.forEach(function (element) {
        x += element;
      });
      return x;
    }
  }
};
